import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FiGithub, FiExternalLink, FiCode, FiStar, FiEye } from 'react-icons/fi';

const Projects = () => {
  const [filter, setFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: "Password Manager AI",
      description: "A secure password management application with AI-powered password suggestions and analytics dashboard.",
      longDescription: "Built with React, Node.js, and MongoDB, this application features AES-256 encryption, WebAuthn authentication, and an intelligent dashboard that provides password security analytics and AI-generated strong password suggestions.",
      image: "/api/placeholder/600/400",
      technologies: ["React", "Node.js", "MongoDB", "AES-256", "WebAuthn", "JWT"],
      category: "fullstack",
      github: "https://github.com/garimajain16/password-manager",
      live: "https://password-manager-demo.vercel.app",
      featured: true,
      stats: {
        stars: 45,
        views: 1200
      }
    },
    {
      id: 2,
      title: "E-Commerce Dashboard",
      description: "Modern admin dashboard for e-commerce management with analytics and inventory tracking.",
      longDescription: "A comprehensive admin dashboard built with React and Tailwind CSS, featuring sales analytics, inventory management, order tracking, and customer management. Includes beautiful charts and responsive design.",
      image: "/api/placeholder/600/400",
      technologies: ["React", "Tailwind CSS", "Chart.js", "Firebase"],
      category: "frontend",
      github: "https://github.com/garimajain16/ecommerce-dashboard",
      live: "https://ecommerce-admin-demo.vercel.app",
      featured: true,
      stats: {
        stars: 28,
        views: 650
      }
    },
    {
      id: 3,
      title: "Task Management API",
      description: "RESTful API for task management with authentication and real-time updates.",
      longDescription: "A robust backend API built with Node.js and Express, featuring JWT authentication, real-time updates with Socket.io, and comprehensive task management capabilities including team collaboration features.",
      image: "/api/placeholder/600/400",
      technologies: ["Node.js", "Express", "MongoDB", "Socket.io", "JWT"],
      category: "backend",
      github: "https://github.com/garimajain16/task-api",
      live: "https://task-api-docs.vercel.app",
      featured: false,
      stats: {
        stars: 19,
        views: 420
      }
    },
    {
      id: 4,
      title: "Weather App",
      description: "Beautiful weather application with location-based forecasts and interactive maps.",
      longDescription: "A responsive weather application that provides current weather conditions, 7-day forecasts, and interactive weather maps. Features location-based weather detection and beautiful animations.",
      image: "/api/placeholder/600/400",
      technologies: ["React", "Weather API", "Mapbox", "Tailwind CSS"],
      category: "frontend",
      github: "https://github.com/garimajain16/weather-app",
      live: "https://weather-app-demo.vercel.app",
      featured: false,
      stats: {
        stars: 15,
        views: 380
      }
    },
    {
      id: 5,
      title: "Portfolio Website",
      description: "Modern, responsive portfolio website with advanced animations and features.",
      longDescription: "A professional portfolio website built with React, Tailwind CSS, and Framer Motion. Features dark/light theme, command palette, interactive components, and optimized performance.",
      image: "/api/placeholder/600/400",
      technologies: ["React", "Tailwind CSS", "Framer Motion", "Vercel"],
      category: "frontend",
      github: "https://github.com/garimajain16/portfolio",
      live: "https://garimajain.vercel.app",
      featured: false,
      stats: {
        stars: 12,
        views: 290
      }
    }
  ];

  const categories = [
    { id: 'all', name: 'All Projects' },
    { id: 'fullstack', name: 'Full Stack' },
    { id: 'frontend', name: 'Frontend' },
    { id: 'backend', name: 'Backend' },
    { id: 'iot', name: 'IoT' },
    { id: 'marketing', name: 'Marketing' }
  ];

  const filteredProjects = filter === 'all' 
    ? projects 
    : projects.filter(project => project.category === filter);

  const featuredProjects = projects.filter(project => project.featured);

  return (
    <div className="min-h-screen pt-20 pb-16">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h1 className="text-4xl md:text-5xl font-bold gradient-text mb-6">
            My Projects
          </h1>
          <p className="text-xl text-gray-600 dark:text-gray-300 max-w-3xl mx-auto">
            A collection of projects showcasing my skills in full-stack development, IoT, and digital marketing
          </p>
        </motion.div>

        {/* Featured Projects */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="mb-16"
        >
          <h2 className="text-3xl font-bold text-gray-900 dark:text-white mb-8 text-center">
